css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #acafbe;
  padding: 0.5rem;
  border-bottom: 1px solid #2e303c;
  display: flex;
  align-items: center;
}
.github-Accordion-header::-webkit-details-marker {
  color: #acafbe;
}
.github-Accordion--rightTitle,
.github-Accordion--leftTitle {
  flex: 1;
}
.github-Accordion-content {
  border-bottom: 1px solid #2e303c;
  background-color: #3b3e4d;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #acafbe;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #d3d6e4;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 0.25rem;
  border-bottom: 1px solid #2e303c;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #292D3E;
}
